num_galaxies = list(coordinoate_dict.keys())[-1]

expand_factor = 1000000-1
def get_min_distance(coordinate_a, coordinate_b):
    a_row, a_col = coordinate_a[0], coordinate_a[1]
    b_row, b_col = coordinate_b[0], coordinate_b[1]
    distance = (max(a_row, b_row) - min(a_row, b_row)) + (max(a_col, b_col) - min(a_col, b_col))
    for n in empty_row:
        if n > min(a_row, b_row) and n < max(a_row, b_row):
            distance += expand_factor
    
    for n in empty_col:
        if n > min(a_col, b_col) and n < max(a_col, b_col):
            distance += expand_factor
    return distance


